decision_conditions:
Conditions

1) The development hereby permitted shall begin not later than 3 years from the date of this decision.

2) The development hereby permitted shall be carried out in accordance with the following approved plans: 214026_PA_110C, 214026_PA_120C, 214026_PA_121D, 214026_122D, 214026_PA_123D, 214026_PA_124D, 214026_125D, 214026_PA_130E, 214026_PA_131C, 214026_PA_132C, 214026_PA_133C, 214026_PA_134C, 214026_PA_135, 214026_PA_200D, 214026_PA_201C and 214026_PA_202.

3) No development shall take place until a piling method statement has been submitted to and approved in writing by the local planning authority. Development shall be carried out in accordance with the approved details.

4) No development shall take place, including any works of demolition, until a Construction Method Statement has been submitted to, and approved in writing by the local planning authority. The Statement shall provide for:
i) the parking of vehicles of site operatives and visitors;
ii) loading and unloading of plant and materials;
iii) storage of plant and materials used in constructing the development;
iv) the erection and maintenance of security hoarding including decorative displays and facilities for public viewing, where appropriate;
v) wheel washing facilities;
vi) measures to control the emission of dust and dirt during construction;
vii) a scheme for recycling/disposing of waste resulting from demolition and construction works;
viii) delivery, demolition and construction working hours.
The approved Construction Method Statement shall be adhered to throughout the construction period for the development.

5) No development shall commence until an assessment of the risks posed by any contamination, carried out in accordance with British Standard BS 10175: Investigation of potentially contaminated sites - Code of Practice and the Environment Agencys Model Procedures for the Management of Land Contamination (CLR 11) (or equivalent British Standard and Model Procedures if replaced), shall have been submitted to and approved in writing by the local planning authority. If any contamination is found, a report specifying the measures to be taken, including the timescale, to remediate the site to render it suitable for the approved development shall be submitted to and approved in writing by the local planning authority. The site shall be remediated in accordance with the approved measures and timescale and a verification report shall be submitted to and approved in writing by the local planning authority. If, during the course of development, any contamination is found which has not been previously identified, work shall be suspended and additional measures for its remediation shall be submitted to and approved in writing by the local planning authority. The remediation of the site shall incorporate the approved additional measures and a verification report for all the remediation works shall be submitted to the local planning authority within 1 month of the report being completed and approved in writing by the local planning authority.

6) No development shall take place until a scheme for compliance with Secured by Design and a timetable for accreditation following first occupation has been submitted to and approved in writing by the local planning authority. Development shall be carried out in accordance with the approved details.

7) No development shall take place until a scheme with the detail and maintenance plan relating to the element of the building over sailing the highway has been submitted to and approved in writing by the local planning authority. Development shall be carried out in accordance with the approved details.

8) No development shall take place until detailed plans for the installation of bat boxes has been submitted to and approved in writing by the local planning authority. Development shall be carried out in accordance with the approved details.

9) No development shall take place until a plan for the detailed design of the child play space and maintenance plan has been submitted to and approved in writing by the local planning authority. Development shall be carried out in accordance with the approved details.

10) No development shall take place until details of the mechanical ventilation to the flats facing Eastern Avenue has been submitted to and approved in writing by the local planning authority. Development shall be carried out in accordance with the approved details. 

11) No development shall take place until samples of all external facing materials, including, Brickwork; Cladding; Windows and doors (including reveals and frames); Balconies and balustrades; External guttering; Canopies; Details of all rooftop structures including flues, satellite dishes, plant, lift overruns, cleaning cradles; Details of all rooftop structures including flues, satellite dishes, plant, lift overruns, cleaning cradles; Noticeboards; and, Plant enclosures have been submitted to and approved by the local planning authority in writing. The relevant works shall be carried out in accordance with the approved sample details.

12) No development shall take place until a scheme for water efficiency measures to be incorporated into the dwellings (in accordance with Part G2 of the Building Regulations) has been submitted to and approved in writing by the local planning authority. Development shall be carried out in accordance with the approved details.

13) Prior to occupation a scheme detailing the wheelchair user dwellings and the measures within the development to accord with document M4 (2) and (3) along with evidence of compliance have been submitted to and approved in writing by the local planning authority. Development shall be carried out in accordance with the approved details.

14) No development shall commence until details of both hard and soft landscape works have been submitted to and approved in writing by the local planning authority. These details shall include:
i) a statement setting out the design objectives and how these will be delivered;
ii) earthworks showing existing and proposed finished levels or contours;
iii) means of enclosure and retaining structures;
iv) boundary treatments;
v) vehicle parking layouts;
vi) other vehicle and pedestrian access and circulation areas;
vii) hard surfacing materials;
viii) proposed and existing functional services above and below ground;
ix) renewable energy installations where relevant;
x) lighting, floodlighting and CCTV;
xi) water features;
xii) an implementation programme
The landscaping works shall be carried out in accordance with the approved details before any part of the development is first occupied in accordance with the agreed implementation programme. The completed scheme shall be managed and/or maintained in accordance with an approved scheme of management and/or maintenance.

15) Prior to first occupation of the development hereby permitted, details of privacy screens to the balconies of flats C1.2, C2.2, C3,2, C4.2, C5.2, C6.2, E2.1, E3.1, E4.1 and E5.1 shall be submitted to and approved in writing by the Local Planning Authority. The privacy screens shall be installed prior to first occupation of the development and shall be retained thereafter.

16) Prior to occupation of the development hereby permitted, a Car Park Management Plan (CPMP) shall be submitted to and approved in writing by the Local Planning Authority. The CPMP shall include details of:
a) How the sixty-five residential car parking spaces will be allocated to occupants of the proposed flats and details of process of any future re-allocation, and details of how 17 of the car parking spaces will be allocated to blue badge holders within the approved residential development and details of process of any future re-allocation; and
b) Details of provision of active electric vehicle charging points for 20% of the residential car parking spaces and a further 20% passive provision.
The development shall only be occupied in accordance with these approved details.

17) Before the development hereby permitted is occupied a scheme shall be submitted to and approved in writing by the Local Planning Authority describing the means by which the provision and implementation of transport improvements within the vicinity of the site are to be achieved. Details shall include the reinstatement of redundant crossovers, the installation of new crossovers and the installation of two disabled parking bays on Hertford Road. The agreed measure shall form part of a S278 Agreement with the Council and the works shall be undertaken to an agreed
time frame. The development shall not be occupied otherwise than in accordance with the approved scheme.

18) The development shall achieve carbon emission reduction savings of no less than 22.6% below the Target Emissions Rate in Building Regulations (2013) in accordance with the Energy and Sustainability Statement Version 2: October 2016. Prior to first occupation a statement (with supporting evidence) shall be submitted to and approved in writing by the Local Planning Authority to demonstrate that the above has been achieved.

19) Prior to first occupation of the development hereby permitted details of acoustic and vibration insulation measures with associated ventilation shall be submitted to and approved in writing by the Local Planning Authority. The development shall not be occupied otherwise than in accordance with the approved details.

20) Prior to first occupation of the development hereby approved, details of all permanent external lighting, including the location, specification, fixtures and fittings, measures to reduce light spillage and the maintenance of such external lighting, shall be submitted to and approved in writing by the Local Planning Authority before the external lighting is installed. All external lighting as approved shall be installed prior to first occupation, and shall be installed and maintained in accordance with the approved details.

21) Notwithstanding the details shown on the plans hereby approved, prior to first occupation of the residential development a photovoltaic (PV) array of no less than 77.22kWp shall be installed on the roofs of the residential development hereby approved and be operational. A statement, with supporting evidence, shall be submitted to the Local Planning Authority upon first occupation to demonstrate that an operational PV array of 77.22kWp has been achieved.

22) Notwithstanding the details shown on the approved plans, prior to first occupation of the development, details of refuse and recycling storage shall be submitted to and approved in writing by the Local Planning Authority. These details shall include the number of Eurobins provided, the routes from the stores to the collection points and provision for the storage of bulky goods. They shall be provided at the site prior to first occupation of these dwellings and shall be retained at the site thereafter in accordance with the approved details at all times.

23) The 67 car parking spaces shown on the plans hereby approved shall be provided at the site prior to occupation and shall be retained at the site thereafter in accordance with the approved drawings.

24) The 303 cycle parking spaces, including 5% provision for larger cycles and visitor cycle parking spaces shall be provided prior to occupation and shall be retained thereafter in accordance with the approved drawings.

25) The development hereby approved shall be carried out in accordance with the Surface Water Drainage and SUDS Review Version 1.1 (16 May 2017).
